import React, {Component} from "react";

class OemDetail extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded:false,
            items:[]
        }
    }

    componentDidMount(){
        var rooturl = window.location.href;
        rooturl = rooturl.split(":");
        var eom_id = rooturl[3];
        console.log(rooturl);
        var fetchurl = 'http://13.233.237.220:8091/getOemdetailsById?oem_id='+eom_id;
        console.log(fetchurl);
        fetch(fetchurl).
        then(res=>res.json()).
        then(json => {
            this.setState({
                isLoaded:true,
                items:json
            })
        });
    }


    render(){
        console.log(this.state.items);
        var { isLoaded, items } = this.state;
        if(!isLoaded){
            return <div>Loading ...</div>
        }else{
            return (
            <div>
                <a href="/oemrecord">View All</a>
                {items.map(item=>(
                    <div key={item.eom_id}>
                        <p >ID {item.oem_id}</p>
                        <p >Name {item.oem_name}</p>
                        <p >TYPE {item.oem_type}</p>

                     <h3>address Information</h3>
                     <table>
                         <tr>
                             <th>Name</th>
                             <th>Value</th>
                         </tr>
                         <tr>
                             <td>House Number </td>
                             <td>{item.address[0].house_no}</td>
                         </tr>
                         <tr>
                             <td>Flat Name </td>
                             <td>{item.address[0].flat_name}</td>
                         </tr>
                         <tr>
                             <td>Building Number </td>
                             <td>{item.address[0].building_no}</td>
                         </tr>
                         <tr>
                             <td>Address Line </td>
                             <td>{item.address[0].address_line}</td>
                         </tr>
                         <tr>
                             <td>House Number </td>
                             <td>{item.address[0].house_no}</td>
                         </tr>
                     </table>
                    </div>

                ))}
            </div>
            )
        }
    }
}

export default OemDetail;
